import { MdChevronLeft, MdChevronRight } from 'react-icons';
import api from '~/services/api';

import { Container } from './styles';

export default function Dashboard() {
  return (
    <Container>
      <header>
        <button type="button">
          <MdChevronLeft size={36} color="#fff" />
        </button>{' '}
        <button type="button">
          <MdChevronLeft size={36} color="#fff" />
        </button>
      </header>
    </Container>
  );
}
